- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThe Fairfax County Democratic Committee
    is no longer an all volunteer Committee with no paid staff of any kind.  No other
    entity pays compensation for their employees to work for the committee. Beginning
    this month, however, an Executive Director is being paid a full time salary and
    benefits, and he devotes more than 25 percent of his time to federal elections.
    \ Separately, a part time employee is paid to devote all of their compensated
    time to non federal elections. Although the part tiime employees' wages are reported
    to our non federal regulatory agency, the VA State Board of Elections, the payroll
    processing expenses of the non federal employee are billed to the Committee's
    Federal account as overhead. The Fairfax County Democratic Committee maintains
    both Federal and Non Federal accounts, and continuing with this report, it allocates
    qualified joint administrative expenses between accounts. Administrative and overhead
    expenses are apportioned on the 36 percent federal, 64 percent non federal split
    pursuant to regulations and reported here on Schedule H1. Joint operating expenses
    are identified and apportioned in this monthly report on Schedule H4. The transfer
    of accumulated expenses from the Non Federal account to the Federal account will
    occur in August 2008 and will be reported in the September 2008 monthly report.
    The Committee does not engage in any fundraising on behalf of candidates for Federal
    office, so all of its reported fundraising expenses are party fundraising. This
    amendment addresses an inquiry from the FEC dated January 9, 2009, regarding cumulative,
    itemized and unitemized contributions reported on line 11(a) of our Detailed Summary
    Page. This and future reports will not adjust cumulative totals of itemized and
    unitemized contributions when a given donor's reporting threshold of $200 for
    the calendar year is reached. The FEC letter of January 9th also questioned an
    unmatched memo text for Schedule B supporting line 21 (b) of our report. The memo
    text was revised to disclose a corrected amount of $436.79 reimbursed for purchase
    of a projector bulb from Dell Computer Corporation by committee member Sue Langley.
    The memo text was revised to match the reimbursement amount to the cost of the
    projector bulb. The FEC letter asked for clarification of Credit Card Discount
    as a reported expense of the Committee. This is widely recognized terminology
    of the banking industry. The credit card discount is the percentage charged by
    banks to convert credit card vouchers to cash, typically in the range of three
    to five percent of donations charged to credit cards. Other descriptions questioned
    in the FEC letter have been revised in our report to clarify the purpose of parade
    expenses and volunteer party expenses. This amendment also reclassifies payroll
    and related costs of our Executive Director as FEA in Schedule B supporting line
    30(b) of our report. This and future reports will continue to report salaries
    and expenses of our Executive Director, who spends more than 25 percent of his
    compensated time on federal elections, as FEA. His costs will be paid entirely
    with federal funds, with no allocation from the non-federal account. This amendment
    also aligns the starting balance of to this report with the corrected ending balance
    of our amended June 2008 report.\n"
